import Logo from './Logo'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faLinkedinIn, faTwitter, faMediumM, faGithub } from '@fortawesome/free-brands-svg-icons'

class Sidepanel extends React.Component {
    render(){
        return (
            <div className="col-md-3">
                <Logo />
                <div className="side-nav">
                    <ul className="nav flex-column">
                        <li className="nav-item">
                            <a className="nav-link active" href="#">Home</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#">About</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#">Projects</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#">Blog</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#">Experience</a>
                        </li>
                    </ul>
                    <div className="contact">
                    <FontAwesomeIcon icon={faLinkedinIn} size="2x" className="icon" />
                    <FontAwesomeIcon icon={faGithub} size="2x" className="icon" />
                    <FontAwesomeIcon icon={faMediumM} size="2x" className="icon" />
                    <FontAwesomeIcon icon={faTwitter} size="2x" className="icon" />
                    </div>
                </div>
                
            
            
            <style jsx>{`
            .icon{
                padding: 1em;
            }
            .nav{
                border-bottom: 2px solid #fff;
            }
            .nav-item{
                font-size: 1.5em;
                color: #fff !important;
                text-decoration: none;
            }
            li, a{
                color: #fff !important;
                text-decoration: none;
            }
            .col-md-3{
                border-right: 2px solid #fff;
                padding-right: 0px !important;
            }
        `}</style>
            </div>
        );
    }
}

export default Sidepanel;
